import React from 'react'
import { getFullYear, getFooterCopy } from '../utils/utils';

function Footer() {
    return(
    <div class="App-footer">
        <p>Copyright {getFullYear()}- {getFooterCopy()}</p>
    </div>
    );
}

export default Footer;
